import { useState, useEffect, useRef } from "react";
import { Link, useNavigate } from "react-router-dom";
import { useSelector, useDispatch } from "react-redux";
import { logout } from "../redux/slices/authSlice"; // adjust path if needed

export default function Header() {
  const { userInfo } = useSelector((state) => state.auth);
  const dispatch = useDispatch();
  const navigate = useNavigate();
  const [menuOpen, setMenuOpen] = useState(false);
  const menuRef = useRef(null);

  const handleLogout = () => {
    dispatch(logout());
    navigate("/");
  };

  // Close dropdown if clicked outside
  useEffect(() => {
    const handleClickOutside = (event) => {
      if (menuRef.current && !menuRef.current.contains(event.target)) {
        setMenuOpen(false);
      }
    };
    document.addEventListener("mousedown", handleClickOutside);
    return () => {
      document.removeEventListener("mousedown", handleClickOutside);
    };
  }, []);

  return (
    <div className="header-container">
      <div className="container-fluid">
        <div className="header">
          {/* Logo */}
          <div className="logo">
            <Link to="/">
              <img
                src={`${process.env.PUBLIC_URL}/assets/images/aayologo.png`}
                alt="Aayo"
              />
            </Link>
          </div>

          {/* Navigation */}
          <div className="nav">
            <ul>
              <li>
                <Link to="/" className="active">
                  Home
                </Link>
              </li>
              <li>
                <Link to="/features">Features</Link>
              </li>
              <li>
                <Link to="/about">About Us</Link>
              </li>
              {/* <li>
                <Link to="/how-it-works">How it Works</Link>
              </li>
              <li>
                <Link to="/faq">FAQ</Link>
              </li> */}
              <li>
                <Link to="/contact">Contact Us</Link>
              </li>
            </ul>
          </div>

          {/* User Button & Menu */}
          <div className={`button ${menuOpen ? "active" : ""}`} ref={menuRef}>
            {userInfo ? (
              <>
                <button
                  type="button"
                  className="btn btn-blank usermenu-toggle"
                  onClick={() => setMenuOpen(!menuOpen)}
                >
                  <img
                    src={`${process.env.PUBLIC_URL}/assets/images/thumb-driver.png`}
                    alt={userInfo.name}
                  />
                  {userInfo.name}
                  <span className="material-icons-outlined">
                    arrow_drop_down
                  </span>
                </button>

                {menuOpen && (
                  <div className="usermenu-toggle-content">
                    <ul>
                      <li>
                        <Link to="/profile">Profile</Link>
                      </li>
                      <li>
                        <Link to="/change-password">Change Password</Link>
                      </li>
                      <li>
                        <Link to="/logout">Sign Out</Link>
                      </li>
                    </ul>
                  </div>
                )}
              </>
            ) : (
              <>
                <Link to="/login" className="btn btn-blank">
                  Sign In
                </Link>
                <Link to="/register" className="btn btn-fill">
                  Sign Up
                </Link>
              </>
            )}
          </div>
        </div>
      </div>
    </div>
  );
}
